import React, { Component, Fragment } from "react"
import API from "../utils/API"

// const Search = () => {
//     return <h1> Search By Breed!</h1>
// }

class Search extends Component {
    state = {
        breedList: [],
    }

    componentDidMount() {
        API.getBreeds()
        .then(res => this.setState({breedList : res.data.message}))
        .catch(err => console.log(err));
    }

    render() {
        return (
            <Fragment>
                <h1>Search</h1>
                <form>
                    <label htmlFor="breed-choice">Choose a breed: </label>
                    <input list="breed-type" id="breed-choice" name="breed-choice" />

                    <datalist id="breed-type">
                       {this.state.breedList.map(breed =>  <option value={breed} />)}
                    </datalist>
                    <button type="button" className="btn btn-primary">Submit</button>
                </form>
            </Fragment>
        )
    }

}

export default Search;
